import React, { Component } from 'react';
import '../../SCSS/myTeam.scss'

class myTeam extends Component {
    constructor(props){
        super(props)
        this.tid = this.props.tid
        this.teamId = this.props.teamId

    }

    componentDidMount(){
        alert(this.teamId)

    }
    render() {
        return (
            <div id="newContainer">
                Hi
            </div>
        );
    }
}

export default myTeam;
